using System;
using System.IO;

namespace HK4E.HdiffBuilder.Tools;

public static class Hdiffz {
    private const string hdiffzBase64 = """

""";

    public static string Extract() {
        string tempPath = Path.Combine(Path.GetTempPath(), "hdiffz.exe");
        if (!File.Exists(tempPath)) {
            byte[] bin = Convert.FromBase64String(hdiffzBase64);
            File.WriteAllBytes(tempPath, bin);
        }
        return tempPath;
    }
}
